import logo from './logo.svg';
import './App.css';

function App() {

  let posts = '여기는 React 연습 블로그입니다.'
  // 변수를 지정 후, 이 변수를 넣고 싶은 곳에 {변수}로 넣어주면 됨

  return (
    <div className="App">
     {/* class라는 예약어가 있기 때문에 class 지정을 className으로 함*/}
      <div className="black-nav">
        <div>React 연습 Blog</div>
      </div>
      <h4>{posts}</h4>
    </div>
  );
}

export default App;
